import React, { Component } from 'react';
import axios from 'axios';
import { Link, Route } from 'react-router-dom';
import StudentLife from './student-life/student-life/StudentLife';
import Header from '../header/Header';
import Body from '../body/Body';

class Home extends Component {
    state = {
        student:{}
    }
    componentDidMount() {
       const params = {
           email: localStorage.getItem('loggedInStudent')

       }
        axios.get('http://localhost:8080/findByEmail',{params})
        .then(response => {
            this.setState(
                {
                    student: response.data
                }
            )
        })


    }

    render() {
        return (
            <div class="wrapper">
    <nav id="sidebar">
        <div class="sidebar-header">
            <h3>Bootstrap Sidebar</h3>
        </div>

        <ul class="list-unstyled components">
            <p>Dummy Heading</p>
            <li class="active">
                <a href="#homeSubmenu" data-toggle="collapse" aria-expanded="false" class="dropdown-toggle">Home</a>
                <ul class="collapse list-unstyled" id="homeSubmenu">
                    <li>
                        <a href="#">Home 1</a>
                    </li>
                    <li>
                        <a href="#">Home 2</a>
                    </li>
                    <li>
                        <a href="#">Home 3</a>
                    </li>
                </ul>
            </li>
            <li>
                <a href="#">About</a>
            </li>
            <li>
                <a href="#pageSubmenu" data-toggle="collapse" aria-expanded="false" class="dropdown-toggle">Pages</a>
                <ul class="collapse list-unstyled" id="pageSubmenu">
                    <li>
                        <a href="#">Page 1</a>
                    </li>
                    <li>
                        <a href="#">Page 2</a>
                    </li>
                    <li>
                        <a href="#">Page 3</a>
                    </li>
                </ul>
            </li>
            <li>
                <a href="#">Portfolio</a>
            </li>
            <li>
                <a href="#">Contact</a>
            </li>
        </ul>
    </nav>


            <div className="site-wrapper">


                       <br></br>
                        <h1 className="container-center">{this.state.student.firstName}'s Profile
                        <Body/></h1> 

                    <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>
                    <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>
                    <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>
        </div>
        </div>
        );
    }
}

export default Home;
